import React from "react";

const FullScreenVideo = () => {
  return (
    <div style={{ height: "100vh" }}>
      <video
        style={{ width: "100%", height: "100%" }}
        src="./video.mp4"
        autoPlay
        loop
        muted
      />
    </div>
  );
};

export default FullScreenVideo;
